CoinTestCases['msc'] = { tests: CoinTestCases['btc'].tests };
CoinTestCases['xcp'] = { tests: CoinTestCases['btc'].tests };
CoinTestCases['dvc'] = { tests: CoinTestCases['btc'].tests };
CoinTestCases['trc'] = { tests: CoinTestCases['btc'].tests };

var TestStop = false;
	
function HasTests(CoinType)
	{
	return CoinTestCases[CoinType] != undefined && CoinTestCases[CoinType].tests.length > 0;
	}
	
function TestFail(Status)
	{
	TestStop = true;
	$('#self-test-summary').html(
		'---------ERROR------------------\n' + 
		Status + '\n' + $('#self-test-summary').html()
		);
	
	$('#stop-self-tests').attr('disabled', '');
	$('#run-self-tests').removeAttr('disabled');
	}
	
function TestSuccess(Status)
	{
	$('#self-test-summary').html(
		Status + '\n' + $('#self-test-summary').html()
		);
		
	$('#self-test-current').val('');
	}
	
function TestStatus(Status)
	{
	$('#self-test-current').val(Status);
	}
	
function RunElectrumTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess)
	{
	if (TestStop)
		return;
	
	if (Tests != undefined && Tests[j] != undefined)
		{
		try
			{
			var TestHex = Tests[j][0];
			var TestElectrum = Tests[j][1];
			var TestChainKey = Tests[j][2];
			var TestKeys = Tests[j][3];
			var TotalKeys = TestKeys.length;
			var TotalAddress = TestKeys.length / 2;
			var TotalChange = TestKeys.length / 2;
			
			var Current = 0;
			
			// Test Hex conversion to Electrum phrase
			if (TestElectrum != mn_encode(TestHex))
				{
				TestFail(CoinInfo[CoinType].fullName + ' Electrum encoding failed for hex: ' + TestHex + '\nExpected phrase: ' + TestElectrum+ '\nResult: ' + mn_encode(TestHex));
				return;
				}
			
			// Test Electrum phrase to hex
			if (TestHex != mn_decode(TestElectrum))
				{
				TestFail(CoinInfo[CoinType].fullName + ' Electrum decoding failed for phrase: ' + TestElectrum + '\nExpected hex: ' + TestHex + '\nResult: ' + mn_decode(TestElectrum));
				return;
				}
				
			Electrum.init(TestHex, 
				function(Progress, Bytes) 
				{ // Update
				TestStatus('Computing ' + CoinInfo[CoinType].fullName + ' Electrum chain code for hex: ' + TestHex + ' (' + Progress + '%)');				
				},
				function(ChainCode)
				{ // Success
				Log(ChainCode);
				
				// Test electrum chain code
				if (TestChainKey != Crypto.util.bytesToHex(ChainCode))
					{
					TestFail(CoinInfo[CoinType].fullName + ' Electrum chain key computation failed.\n Result: ' +  Crypto.util.bytesToHex(ChainCode) + '\nExpected: ' + TestChainKey);
					return;
					}
				
				var Current = 0;
					
				Electrum.gen(TotalAddress, TotalChange, CoinVersion, 
					function(ResultKey)
					{	// Update
					Log(ResultKey);
					
					var ExpectedKeyWIF = TestKeys[Current][0];
					var ExpectedKeyAddress = TestKeys[Current][1];
					
					var ResultKeyAddress = ResultKey[0];
					var ResultKeyWIF = ResultKey[1];
					var ResultKeyBytes = ResultKey[3];
					
					TestStatus('Testing ' + CoinInfo[CoinType].fullName + ' Electrum chain code for (' + (j+1) + '/' + Total + ') [' + Current + '/' + (TotalAddress+TotalChange) + '] Hex: ' + TestHex + ' ');
					
					// Make sure Result bytes compute to WIF
					if (ResultKeyWIF != (new Omnicoin.ECKey(ResultKeyBytes, CoinVersion, false)).getDetails().privateKeyWIF)
						{
						TestFail('Result bytes: ' + Crypto.util.bytesToHex(ResultKeyBytes) + ' \ndid not compute to WIF' + (Current+1) + ': ' + ResultKeyWIF);
						}
					
					// Make sure Expected WIF computes to address.
					if (ExpectedKeyAddress != (new Omnicoin.ECKey(ExpectedKeyWIF, CoinVersion)).getDetails().address)
						{
						TestFail('Key: ' + ExpectedKeyWIF + ' \ndid not compute to address ' + (Current+1) + ': ' + ExpectedKeyAddress);
						}
					
					// Make sure WIFs match.
					if (ExpectedKeyWIF != ResultKeyWIF)
						{
						TestFail('Key: ' + ExpectedKeyWIF + ' \ndid not match computed key ' + (Current+1) + '\n' + 
							'Result: ' + ResultKeyWIF + '\n' + 
							'Expected: ' + ExpectedKeyWIF);
						}
					
					// Make sure Addresses match.			
					if (ExpectedKeyAddress != ResultKeyAddress)
						{
						TestFail('Key: ' + ExpectedKeyWIF + ' \ndid not match computed address ' + (Current+1) + '\n' + 
							'Result: ' + ResultKeyAddress + '\n' + 
							'Expected: ' + ExpectedKeyAddress);
						}
					
					// Make sure WIF version matches
					if (Omnicoin.ECKey.getVersion(ExpectedKeyWIF) != CoinVersion)
						{
						TestFail('WIF: ' + ExpectedKeyWIF + ' \ndid not match version ' + CoinVersion);
						}
						
					// Make sure address version matches
					if (Omnicoin.Address.getVersion(ExpectedKeyAddress) != CoinVersion)
						{
						TestFail('Address: ' + ExpectedKeyAddress + ' \ndid not match version ' + CoinVersion);
						}
					
					Current++;
					},
					function(a)
					{  // Success
					Log(a);
					
					if (j < Total-1)
						{
						setTimeout(function()
							{
							j++;
							RunElectrumTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
							},0);
						}
					else if (OnSuccess != undefined)
						{
						OnSuccess();
						}
					});				
				/*
				Electrum.gen(TestElectrum, TotalKeys, CoinVersion,			
				function(Key) 
					{ // Update
					var ExpectedKeyWIF = TestKeys[Current][0];
					var ExpectedKeyAddress = TestKeys[Current][1];
					
					var ResultKeyAddress = Key[0];
					var ResultKeyWIF = Key[1];
					var ResultKeyBytes = Key[3];
					
					Current++;
					
					TestStatus('Testing ' + CoinInfo[CoinType].fullName + ' Electrum (' + (j+1) + '/' + Total + ') [' + Current + '/' + TotalKeys + ']');
							
					},
				function() 
					{ // Success	
					});
				*/

				});				
			}
		catch (ex)
			{
			TestFail('Error for ' + CoinInfo[CoinType].fullName + ' Electrum: ' + ex);
			return;
			}
		}
	else if (j < Total-1)
		{
		setTimeout(function()
			{
			j++;
			RunElectrumTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
			},0);
		}
	else if (OnSuccess != undefined)
		{
		OnSuccess();
		}
	}
	
function RunArmoryTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess)
	{
	if (TestStop)
		return;
	
	if (Tests != undefined && Tests[j] != undefined)
		{
		try
			{
			var TestHex = Tests[j][0];
			var TestArmory = Tests[j][1];
			var TestKeys = Tests[j][2];
			var TotalKeys = TestKeys.length;			
			var Current = 0;
			
			// Test Hex codes to Armory key.
			if (TestHex != Crypto.util.bytesToHex(ConvertFromEasy16(TestArmory)))
				{
				TestFail('Hex: ' + TestHex + ' \ndid not encode to armory key: ' + TestArmory);
				return;
				}
			
			// Test Armory key codes to Hex.
			if (TestArmory != ConvertToEasy16(Crypto.util.hexToBytes(TestHex)))
				{
				TestFail('Armory key: ' + TestArmory + ' \ndid not decode to hex: ' + TestHex);
				return;
				}
			
			Armory.gen(TestArmory, TotalKeys, CoinVersion,			
			function(Key) 
				{ // Update
				var ExpectedKeyWIF = TestKeys[Current][0];
				var ExpectedKeyAddress = TestKeys[Current][1];
				
				var ResultKeyAddress = Key[0];
				var ResultKeyWIF = Key[1];
				var ResultKeyBytes = Key[3];
				
				Current++;
				
				TestStatus('Testing ' + CoinInfo[CoinType].fullName + ' Armory (' + (j+1) + '/' + Total + ') [' + Current + '/' + TotalKeys + ']');
				
				// Make sure Result bytes compute to WIF
				if (ResultKeyWIF != (new Omnicoin.ECKey(ResultKeyBytes, CoinVersion, false)).getDetails().privateKeyWIF)
					{
					TestFail('Result bytes: ' + Crypto.util.bytesToHex(ResultKeyBytes) + ' \ndid not compute to WIF' + (Current+1) + ': ' + ResultKeyWIF);
					}
				
				// Make sure Expected WIF computes to address.
				if (ExpectedKeyAddress != (new Omnicoin.ECKey(ExpectedKeyWIF, CoinVersion)).getDetails().address)
					{
					TestFail('Key: ' + ExpectedKeyWIF + ' \ndid not compute to address ' + (Current+1) + ': ' + ExpectedKeyAddress);
					}
				
				// Make sure WIFs match.
				if (ExpectedKeyWIF != ResultKeyWIF)
					{
					TestFail('Key: ' + ExpectedKeyWIF + ' \ndid not match computed key ' + (Current+1) + '\n' + 
						'Result: ' + ResultKeyWIF + '\n' + 
						'Expected: ' + ExpectedKeyWIF);
					}
				
				// Make sure Addresses match.			
				if (ExpectedKeyAddress != ResultKeyAddress)
					{
					TestFail('Key: ' + ExpectedKeyWIF + ' \ndid not match computed address ' + (Current+1) + '\n' + 
						'Result: ' + ResultKeyAddress + '\n' + 
						'Expected: ' + ExpectedKeyAddress);
					}
				
				// Make sure WIF version matches
				if (Omnicoin.ECKey.getVersion(ExpectedKeyWIF) != CoinVersion)
					{
					TestFail('WIF: ' + ExpectedKeyWIF + ' \ndid not match version ' + CoinVersion);
					}
					
				// Make sure address version matches
				if (Omnicoin.Address.getVersion(ExpectedKeyAddress) != CoinVersion)
					{
					TestFail('Address: ' + ExpectedKeyAddress + ' \ndid not match version ' + CoinVersion);
					}
				
				},
			function() 
				{ // Success				
				if (j < Total-1)
					{
					setTimeout(function()
						{
						j++;
						RunArmoryTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
						},0);
					}
				else if (OnSuccess != undefined)
					{
					OnSuccess();
					}
				});			
			}
		catch (ex)
			{
			TestFail('Error for ' + CoinInfo[CoinType].fullName + ' Armory: ' + ex);
			return;
			}
		}
	else if (j < Total-1)
		{
		setTimeout(function()
			{
			j++;
			RunArmoryTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
			},0);
		}
	else if (OnSuccess != undefined)
		{
		OnSuccess();
		}
	}
	
function RunEncTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess)
	{
	if (TestStop)
		return;
	
	if (Tests != undefined && Tests[j] != undefined)
		{
		var TestKey = Tests[j][0];
		var TestPass = Tests[j][1];
		var TestExpectedResult = Tests[j][2];
		var TestExpectedAddress = Tests[j][3];
		
		try
			{
			var Key = new Omnicoin.ECKey(TestKey, CoinVersion).getDetails();
			var KeyWIF = Key.privateKeyWIF;
			var Compressed = Key.compressed;
			var Address = Key.address;
			
			TestStatus(CoinInfo[CoinType].fullName + ' Encryption Test (' + ((j*2)+1)+ '/' + (Total*2)+ ')');

			if ((new Omnicoin.ECKey(KeyWIF)).getDetails().address != TestExpectedAddress)
				{
				TestFail('Encryption address did not compute for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
					' \nExpected: ' + TestExpectedAddress + 
					' \nActual: ' + (new Omnicoin.ECKey(KeyWIF)).getDetails().address);
				return;
				}
			
			// Encryption test
			Bitcoin.BIP38.PrivateKeyToEncryptedKeyAsync(KeyWIF, TestPass, Compressed, Address, function (EncWIF, EncAddress)
				{
				if (EncWIF != TestExpectedResult)
					{					
					if (TestExpectedResult == '')
						{						
						TestSuccess('Encryption result did not match for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
							' \nExpected: ' + TestExpectedResult + 
							' \nActual: ' + EncWIF);
						}
					else
						{
						TestFail('Encryption result did not match for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
							' \nExpected: ' + TestExpectedResult + 
							' \nActual: ' + EncWIF);
					
						return;
						}
					}
				
				if (EncAddress != TestExpectedAddress)
					{
					TestFail('Encryption address did not match for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
						' \nExpected: ' + TestExpectedAddress + 
						' \nActual: ' + EncAddress);
					return;
					}
				
				TestStatus(CoinInfo[CoinType].fullName + ' Decryption Test (' + ((j*2)+1+1)+ '/' + (Total*2)+ ')');
			
				// Decryption test
				Bitcoin.BIP38.EncryptedKeyToByteArrayAsync(EncWIF, TestPass, CoinVersion, function (DecryptedBytes, Compression)
					{
					var DecHex = Crypto.util.bytesToHex(DecryptedBytes);
					
					var Key2 = new Omnicoin.ECKey(DecHex, CoinVersion, Compression).getDetails();
					var KeyWIF2 = Key2.privateKeyWIF;
					var Compressed2 = Key2.compressed;
					var Address2 = Key2.address;
					
					if (Compressed != Compressed2)
						{
						TestFail('Decryption compression result did not match for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
							' \nExpected: ' + Compressed + 
							' \nActual: ' + Compressed2);
							
						return;
						}
					
					if (KeyWIF2 != TestKey)
						{
						TestFail('Decryption WIF result did not match for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
							' \nExpected: ' + TestKey + 
							' \nActual: ' + KeyWIF2);
							
						return;
						}
					
					if (Address2 != TestExpectedAddress)
						{
						TestFail('Decryption address did not match for ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
							' \nExpected: ' + TestExpectedAddress + 
							' \nActual: ' + Address2);
							
						return;
						}
					
					if (j < Total-1)
						{
						setTimeout(function()
							{
							j++;
							RunEncTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
							},0);
						}
					else if (OnSuccess != undefined)
						{
						OnSuccess();
						}
					});
				});
			
				
			}
		catch (ex)
			{
			TestFail('Error for ' + CoinInfo[CoinType].fullName + ' encryption: ' + ex);
			return;
			}
		}
	else if (j < Total-1)
		{
		setTimeout(function()
			{
			j++;
			RunEncTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
			},0);
		}
	else if (OnSuccess != undefined)
		{
		OnSuccess();
		}
	}
	
function RunKeyTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess)
	{
	if (TestStop)
		return;
	
	if (CoinType == 'fail')
		{
		var TestArg1 = Tests[j][0][0];
		var TestArg2 = Tests[j][0][1];
		var TestArg3 = Tests[j][0][2];
		
		var ExpectedError = Tests[j][1];
		
		TestStatus('Failure Test (' + (j+1)+ '/' + Total+ ')');
		
		try
			{			
			var Result = (new Omnicoin.ECKey(TestArg1, TestArg2, TestArg3)).getDetails();

			TestFail('Failure test error ' + (j+1) + '. \n' + 
				'Expected: ' + ExpectedError + '\n' +
				'Actual: [none]');
			}
		catch (ex)
			{
			if (ex != ExpectedError)
				{
				TestFail('Failure test error ' + (j+1) + '. \n' + 
					'Expected: ' + ExpectedError + '\n' +
					'Actual: ' + ex);
				}
			}
		}
	else if (Tests != undefined && Tests[j] != undefined && Tests[j][0] != '')
		{
		var TestKey = Tests[j][0];
		var TestResults = Tests[j][1];
		var TestResults_Uncompressed = Tests[j][1][0];
		var TestResults_Compressed = Tests[j][1][1];
		
		TestStatus('Testing ' + CoinInfo[CoinType].fullName + ' Key (' + (j+1)+ '/' + Total+ ') : ' + TestKey);
		
		try
			{
			var ResultKey_Uncompressed = (new Omnicoin.ECKey(TestKey, CoinVersion, false)).getDetails();
			var ResultKey_Compressed = (new Omnicoin.ECKey(TestKey, CoinVersion, true)).getDetails();
			
			// Also test addresses generated using the resulting WIF. 
			// Compression status should be left out as it is included in the WIF. This will test the compression detection.
			var ResultKeyWIF_Uncompressed = (new Omnicoin.ECKey(TestResults_Uncompressed[1], CoinVersion)).getDetails();
			var ResultKeyWIF_Compressed = (new Omnicoin.ECKey(TestResults_Compressed[1], CoinVersion)).getDetails();
			}
		catch (ex)
			{
			TestFail('Error for ' + CoinInfo[CoinType].fullName + ': ' + ex);
			return;
			}
			
		// Test address version
		if (ResultKey_Uncompressed.addressVersion != CoinVersion)
			TestFail('Address version did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + CoinVersion + 
			' \nActual: ' + ResultKey_Uncompressed.addressVersion);
			
		if (ResultKey_Compressed.addressVersion != CoinVersion)
			TestFail('Address version did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + CoinVersion + 
			' \nActual: ' + ResultKey_Compressed.addressVersion);
			
		if (ResultKeyWIF_Uncompressed.addressVersion != CoinVersion)
			TestFail('Address version status did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key ' + ResultKeyWIF_Uncompressed.privateKeyWIF + 
			' \nExpected: ' + CoinVersion + 
			' \nActual: ' + ResultKeyWIF_Uncompressed.addressVersion);
			
		if (ResultKeyWIF_Compressed.addressVersion != CoinVersion)
			TestFail('Address version status did not match for compressed ' + CoinInfo[CoinType].fullName + ' key ' + ResultKeyWIF_Compressed.privateKeyWIF + 
			' \nExpected: ' + CoinVersion + 
			' \nActual: ' + ResultKeyWIF_Compressed.addressVersion);
		
		// Test compression flag
		if (ResultKey_Uncompressed.compressed != TestResults_Uncompressed[0])
			TestFail('Uncompressed status did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key ' + TestKey);
			
		if (ResultKey_Compressed.compressed != TestResults_Compressed[0])
			TestFail('Compressed status did not match for compressed ' + CoinInfo[CoinType].fullName + ' key ' + TestKey);
			
		if (ResultKeyWIF_Uncompressed.compressed != TestResults_Uncompressed[0])
			TestFail('Compressed status did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key ' + ResultKeyWIF_Uncompressed.privateKeyWIF);
			
		if (ResultKeyWIF_Compressed.compressed != TestResults_Compressed[0])
			TestFail('Compressed status did not match for compressed ' + CoinInfo[CoinType].fullName + ' key ' + ResultKeyWIF_Compressed.privateKeyWIF);
			
		// Test Private Key WIF
		if (ResultKey_Uncompressed.privateKeyWIF != TestResults_Uncompressed[1])
			TestFail('Private Key WIF did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Uncompressed[1] + 
			' \nActual: ' + ResultKey_Uncompressed.privateKeyWIF);
			
		if (ResultKey_Compressed.privateKeyWIF != TestResults_Compressed[1])
			TestFail('Private Key WIF did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Compressed[1] + 
			' \nActual: ' + ResultKey_Compressed.privateKeyWIF);
		
		// Private Key WIF, backwards			
		if (ResultKeyWIF_Uncompressed.privateKey != TestKey)
			TestFail('Private Key did not decode for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Uncompressed.privateKey + 
			' \nExpected: ' + TestKey + 
			' \nActual: ' + ResultKeyWIF_Uncompressed.privateKey);
			
		if (ResultKeyWIF_Compressed.privateKey != TestKey)
			TestFail('Private Key did not decode for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Compressed.privateKey + 
			' \nExpected: ' + TestKey + 
			' \nActual: ' + ResultKeyWIF_Compressed.privateKey);
			
		// Public Key
		if (ResultKey_Uncompressed.publicKey != TestResults_Uncompressed[2])
			TestFail('Public Key did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Uncompressed[2] + 
			' \nActual: ' + ResultKey_Uncompressed.publicKey);
			
		if (ResultKey_Compressed.publicKey != TestResults_Compressed[2])
			TestFail('Public Key did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Compressed[2] + 
			' \nActual: ' + ResultKey_Compressed.publicKey);
			
		if (ResultKeyWIF_Uncompressed.publicKey != TestResults_Uncompressed[2])
			TestFail('Public Key did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Uncompressed.privateKey + 
			' \nExpected: ' + TestResults_Uncompressed[2] + 
			' \nActual: ' + ResultKeyWIF_Uncompressed.publicKey);
			
		if (ResultKeyWIF_Compressed.publicKey != TestResults_Compressed[2])
			TestFail('Public Key did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Compressed.privateKey + 
			' \nExpected: ' + TestResults_Compressed[2] + 
			' \nActual: ' + ResultKeyWIF_Compressed.publicKey);
		
		// Hash160
		if (ResultKey_Uncompressed.publicKeyHash != TestResults_Uncompressed[3])
			TestFail('Hash160 did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Uncompressed[3] + 
			' \nActual: ' + ResultKey_Uncompressed.publicKeyHash);
			
		if (ResultKey_Compressed.publicKeyHash != TestResults_Compressed[3])
			TestFail('Hash160 did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Compressed[3] + 
			' \nActual: ' + ResultKey_Compressed.publicKeyHash);
			
		if (ResultKeyWIF_Uncompressed.publicKeyHash != TestResults_Uncompressed[3])
			TestFail('Hash160 did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Uncompressed.privateKey + 
			' \nExpected: ' + TestResults_Uncompressed[3] + 
			' \nActual: ' + ResultKeyWIF_Uncompressed.publicKeyHash);
			
		if (ResultKeyWIF_Compressed.publicKeyHash != TestResults_Compressed[3])
			TestFail('Hash160 did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Compressed.privateKey + 
			' \nExpected: ' + TestResults_Compressed[3] + 
			' \nActual: ' + ResultKeyWIF_Compressed.publicKeyHash);
		
		// Address
		if (ResultKey_Uncompressed.address != TestResults_Uncompressed[4])
			TestFail('Address did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Uncompressed[4] + 
			' \nActual: ' + ResultKey_Uncompressed.address);
			
		if (ResultKey_Compressed.address != TestResults_Compressed[4])
			TestFail('Address did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + TestKey + 
			' \nExpected: ' + TestResults_Compressed[4] + 
			' \nActual: ' + ResultKey_Compressed.address);
			
		if (ResultKeyWIF_Uncompressed.address != TestResults_Uncompressed[4])
			TestFail('Address did not match for uncompressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Uncompressed.privateKey + 
			' \nExpected: ' + TestResults_Uncompressed[4] + 
			' \nActual: ' + ResultKeyWIF_Uncompressed.address);
			
		if (ResultKeyWIF_Compressed.address != TestResults_Compressed[4])
			TestFail('Address did not match for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Compressed.privateKey + 
			' \nExpected: ' + TestResults_Compressed[4] + 
			' \nActual: ' + ResultKeyWIF_Compressed.address);
		
		// Test Key getVersion;			
		if (Omnicoin.ECKey.getVersion(ResultKeyWIF_Uncompressed.privateKeyWIF) != CoinVersion)
			TestFail('ECKey getVersion failed for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Uncompressed.privateKey + 
			' \nExpected: ' + Omnicoin.ECKey.getVersion(ResultKeyWIF_Uncompressed.privateKeyWIF) + 
			' \nActual: ' + CoinVersion);
			
		if (Omnicoin.ECKey.getVersion(ResultKeyWIF_Compressed.privateKeyWIF) != CoinVersion)
			TestFail('ECKey getVersion failed for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Compressed.privateKey + 
			' \nExpected: ' + Omnicoin.ECKey.getVersion(ResultKeyWIF_Compressed.privateKeyWIF) + 
			' \nActual: ' + CoinVersion);
		
		// Test Address getVersion	
		if (Omnicoin.Address.getVersion(ResultKeyWIF_Uncompressed.address) != CoinVersion)
			TestFail('Address getVersion failed for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Uncompressed.address + 
			' \nExpected: ' + Omnicoin.Address.getVersion(ResultKeyWIF_Uncompressed.address) + 
			' \nActual: ' + CoinVersion);
			
		if (Omnicoin.Address.getVersion(ResultKeyWIF_Compressed.address) != CoinVersion)
			TestFail('Address getVersion failed for compressed ' + CoinInfo[CoinType].fullName + ' key: ' + ResultKeyWIF_Compressed.address + 
			' \nExpected: ' + Omnicoin.Address.getVersion(ResultKeyWIF_Compressed.address) + 
			' \nActual: ' + CoinVersion);		
		}
	
	if (j < Total-1)
		{
		setTimeout(function()
			{
			j++;
			RunKeyTest(CoinType, CoinVersion, Tests, Total, j, OnSuccess);
			},0);
		}
	else if (OnSuccess != undefined)
		{
		OnSuccess();
		}
	}
	
